import React from 'react'
import Card from '../components/card'

export default function CardContainer({ cards }) {

    const renderCards = () => cards.map(card => {
        return <Card card={ card } />
    })

    return (
        <div className="all-cards">
            all cards here
            {renderCards}
        </div>
    )
}
